void worker::NotifyFinished()
{
  StateCallback stateCallback = Callback::GetStateCallback();
  if (stateCallback)
  {
    stateCallback(Idle);
  }
}

void worker::NotifyPaused()
{
  StateCallback stateCallback = Callback::GetStateCallback();
  if (stateCallback)
  {
    stateCallback(Paused);
  }
}

void worker::NotifyRunning()
{
  StateCallback stateCallback = Callback::GetStateCallback();
  if (stateCallback)
  {
    stateCallback(Running);
  }
}

