void worker::Play()
{
  mutex.lock();
  play = true;
  pause = false;
  stop = false;
  mutex.unlock();
  pauseManager.notify_all();
  DLL_Parametrs.Dll_State = DLL_Parametrs.Running;
  NotifyRunning();
}

void worker::Pause()
{
  mutex.lock();
  play = false;
  pause = true;
  stop = false;
  mutex.unlock();
  DLL_Parametrs.Dll_State = DLL_Parametrs.Paused;
  NotifyPaused();
}

void worker::Stop()
{
  mutex.lock();
  play = false;
  pause = false;
  stop = true;
  mutex.unlock();
  DLL_Parametrs.Dll_State = DLL_Parametrs.Idle;
  pauseManager.notify_all();
}
